const helpers = (prototype) => {
  Object.defineProperties(prototype, {
    simpleName: {
      get: function () {
        if (!this) return;
        return utils.getSimpleName(this);
      },
    },
    namedClasses: {
      get: function () {
        if (!this) return;
        return utils.getNamedClasses(this);
      },
    },
    entries: {
      get: function () {
        if (!this) return;
        return Object.entries(this);
      },
    },
    string: {
      get: function () {
        if (!this || !this.toString) return;
        return this.toString();
      },
    },
  });
};
/* ГђВІГђВѕГ‘ВЃГ‘ВЃГ‘вЂљГђВ°ГђВЅГђВѕГђВІГђВ»ГђВµГђВЅГђВёГђВµ Г‘вЂљГ‘Ж’ Г‘ВЃГ‘вЂљГ‘в‚¬ГђВёГђВЅГђВі Г‘ВЃГђВёГђВјГђВїГђВ» ГђВЅГђВµГђВ№ГђВјГђВѕГђВІ*/
const restoreToString = (name, prototype) => {
  const string = prototype.toString.toString();
  const fields = Array.from(
    string.matchAll(
      /(?:(?:\w+)="\+this\.(?:\w+)\.)|(?:(?:\w+)="\+this\.(?:\w+)\()|(?:(?<name>\w+)="\+(?:\w+?\()?this\.(?<mangledName>\w+)\)?)/g
    )
  ).map((field) => field.groups);

  if (!name) {
    name =
      string.match(/return"(\w+)/)?.[1] ||
      string.match(/function\(\)\{var [\w$]+="(\w+) \[/)?.[1];
  }

  const properties = {};
  fields.forEach((field) => {
    if (field.name && field.mangledName) {
      properties[field.name] = utils.createProperty(field.mangledName);
    }
  });

  Object.defineProperties(prototype, properties);
  return name;
};
const restoreViaNew = () => {
  for (const classInfo of restore.classesInfo) {
    const sourceClassName = classInfo.shift();

    if (!unsafeWindow[sourceClassName]) {
      continue;
    }

    let sourceClass;

    try {
      sourceClass = new unsafeWindow[sourceClassName]();
    } catch (error) {
      console.log(`${sourceClassName} :(`);
      continue;
    }

    if (!sourceClass) {
      continue;
    }

    classInfo.forEach((className, index) => {
      if (!className) {
        return;
      }

      const constructor =
        Object.values(sourceClass)[index]?.__proto__?.constructor;

      if (!constructor?.$metadata$) {
        console.log(`мы проебали ${className} в ${sourceClassName}`);
        return;
      }
      putConstructorInWindow(constructor, className);
    });
  }
};

/* Г‘в‚¬ГђВµГ‘ВЃГ‘вЂљГђВѕГ‘в‚¬ ГђВѕГ‘ВЃГђВЅГђВѕГђВІГђВЅГђВѕГђВ№ Г‘вЂЎГђВ°Г‘ВЃГ‘вЂљГђВё Г‘ВЃГђВёГђВјГђВїГђВ» ГђВЅГђВµГђВ№ГђВјГђВѕГђВІ Г‘ВЃ ГђВїГђВѕГђВјГђВѕГ‘вЂ°Г‘Е’Г‘ЕЅ Г‘в‚¬ГђВµГђВіГ‘Ж’ГђВ»Г‘ВЏГ‘в‚¬ГђВѕГђВє ГђВєГђВѕГђВЅГ‘ВЃГ‘вЂљГ‘в‚¬Г‘Ж’ГђВєГ‘вЂљГђВѕГ‘в‚¬ГђВѕГђВІ ГђВё ГђВїГ‘в‚¬ГђВѕГ‘вЂљГђВѕГ‘вЂљГђВёГђВї */

const restoreViaRegex = (constructor) => {
  let name;
  const simpleNames = restore.simpleNames;

  for (const [i, [simpleName, index, regex]] of simpleNames.entries()) {
    if (index === -1 && constructor.toString().match(regex)) {
      name = simpleName;
      simpleNames.splice(i, 1);
      unsafeWindow.simpleNames = simpleNames;
      break;
    }

    if (
      utils
        .getPropertyByIndex(constructor.prototype, index)?.[1]
        ?.toString()
        .match(regex)
    ) {
      name = simpleName;
      simpleNames.splice(i, 1);
      unsafeWindow.simpleNames = simpleNames;
      break;
    }
  }

  return name;
};

