const restoreViaHierarchy = () => {
  if (components.length === 0) {
    return;
  }
  for (const info of restore.hierarchy) {
    const startName = info.shift();
    const name = info.pop();

    let startIndex;

    for (const component of components) {
      if (component.$metadata$.simpleName === startName) {
        startIndex = components.indexOf(component);
      }
    }
    for (const index of info) {
      const constructor = components[startIndex + index];
      if (!constructor) {
        console.log(`${name} :(  от ${startName}`);
        continue;
      }

      putConstructorInWindow(constructor, name);
    }
  }
};



