unsafeWindow.setMetadata = (_, constructor,name) => {
  if (!constructor) return;
   components.push(constructor)


    requestAnimationFrame(() => {
        const prototype = constructor.prototype;
        name = restoreToString(name, prototype);

        if (!name && !(name = restoreViaRegex(constructor))) {
            return;
        }


        if (name === lastSimpleName) {
            restoreViaNew();
            restoreViaHierarchy()
            cheatBase.init();
        }

        restoreModels(constructor, name);
        putConstructorInWindow(constructor, name);
        helpers(prototype);
    });
};

